description:
"

  .feature-tab { background-color: #fff; padding: 1em 2em 3em; }
  .feature-tab h3 { font-size: 1.8em; margin: 0.5em 0; line-height: 1.2; }
  .feature-tab h4 { font-size: 1.4em; margin: 1.5em 0 0.5em; }
  .feature-tab ul { padding-left: 1em; }
  .feature-tab li { line-height: 1.4; margin-top: 0.7em; list-style-type: disc; }
  .feature-tab li:first-of-type { margin-top: 0; }
  .feature-tab p { line-height: 1.4; padding: 0.5em 0; font-size: 1.2em; }
  .feature-tab li, .feature-tab p { color: #444; }
  .feature-tab a, .feature-tab p a { color: #09c; }
  .pt_product-details .product-detail-wrapper .product-detail-back .tab-content-new { padding: 0; }



SeeThru® fits MacBook 12" (2015 and 2017 models).
SeeThru is the #1 bestselling hardshell case for MacBook* and is designed to take an impact – and make one.

The form-fitting hardshell on our SeeThru MacBook 12" case keeps scuffs and scratches at bay for on-the-go protection. Its sleek design features a lightweight two-piece design that’s easy to put on and remove. Plus, rubberized feet add stability to prevent sliding and tilting so your MacBook 12" stays grounded. Our Onyx Black color option features a textured, scratch-resistant matte finish that resists scratches, fingerprints, and smudges while providing your MacBook 12" with a comfortable grip.

Like all of our products, this MacBook 12" case has been lab-tested against extreme temperatures, cracks, chemicals, and abrasions.

Speck makes products that are designed for impact to protect the tech you rely on. With a balance of slim lines and military-grade protection, we provide a difference you can see and feel.

*#1 Best-Selling HardShell MacBook Brand. NPD Laptop Cases. 2012-2016. 

