"

    /* NECESSARY */
    .clear { clear: both; }
    #premium { padding-bottom: 4em; }
    #tab-new2 { background-color: #fff; padding: 0; }
    /* PREMIUM CONTENT MODULE GENERIC */
    .module {  }
    .module .content h3 { font-size: 1.75em; line-height: 1.2; color: #09c; text-transform: uppercase; }
    .module .content h3 span { display: block; }
    .module .content h4, .module .content p { color: #666; font-size: 1.3em; line-height: 1.5; margin-top: 1em; font-weight: normal; }
    .module .content a { color: #09c; }
    /* PREMIUM CONTENT MODULE #1 */
    #premium-one { position: relative; }
    #premium-one .content { width: 60%; margin: 2em auto 1em; box-sizing: border-box; padding-left: 8%; }
    #premium-one .content h4 { margin-top: 0; }
    #premium-one .content .badge img { float: left; width: 112px; margin-right: 3%; }
    #premium-one .image img { display: block; margin: 0 auto; width: 100%; }
    /* PREMIUM CONTENT MODULE #2 */
    #premium-two .image img { display: block; margin: 2em auto 0; width: 95%; }
    /* PREMIUM CONTENT MODULE #3 */
    #premium-three { position: relative; }
    #premium-three .image {  }
    #premium-three picture img { width: 100%; margin: 0 auto; }
    #premium-three .content { position: absolute; top: 0; width: 49%; padding: 7% 0 0 5%; }
    /* PREMIUM CONTENT MODULE #4 */
    #premium-four { margin-top: 3em; }
    #premium-four .content, #premium-four .image { float: right; }
    #premium-four .content { width: 20%; text-align: center; padding-top: 1.6%; }
    #premium-four .image { width: 80%; }
    #premium-four picture img { width: 100%; }
    /* PREMIUM CONTENT MODULE #5 */
    #premium-five { float: right; margin: 3em 2em; }
    #premium-five .content a { background: url('http://www.speckproducts.com/on/demandware.static/-/Sites-speck-product-catalog/default/dw708f0750/premium-content/gfx/pc_right-arrow_01_retina.gif') no-repeat top right; padding-right: 1.5em; font-size: 1.75em; line-height: 1.2; color: #09c; font-weight: normal; background-size: contain; text-decoration: none; }
    #premium-five .content a:hover { text-decoration: underline; }
    /* DESKTOP ONLY */
    @media only all and (min-width: 1280px) {
        .mobile { display: none; }
        .desktop { display: block; }
    }
    /* TABLET LANDSCAPE & PORTRAIT */
    @media only all and (max-width: 1280px) and (min-width: 769px) {
        #premium {  }
        /* PREMIUM CONTENT MODULE GENERIC */
        .module {  }
        /* PREMIUM CONTENT MODULE #1 */
        #premium-one .content { width: 80%; }
        /* PREMIUM CONTENT MODULE #2 */
        /* PREMIUM CONTENT MODULE #3 */
        #premium-three .content p { font-size: 1.1em; }
        /* PREMIUM CONTENT MODULE #4 */
        /* PREMIUM CONTENT MODULE #5 */
    }
    /* TABLET LANDSCAPE */
    @media only all and (max-width: 1280px) and (min-width: 1025px) { 
        #premium {  }
        /* PREMIUM CONTENT MODULE GENERIC */
        .module {  }
        /* PREMIUM CONTENT MODULE #1 */
        /* PREMIUM CONTENT MODULE #2 */
        /* PREMIUM CONTENT MODULE #3 */
        /* PREMIUM CONTENT MODULE #4 */
        /* PREMIUM CONTENT MODULE #5 */
    }
    /* TABLET PORTRAIT */
    @media only all and (max-width: 1024px) and (min-width: 769px) {
        #premium {  }
        /* PREMIUM CONTENT MODULE GENERIC */
        .module {  }
        /* PREMIUM CONTENT MODULE #1 */
        /* PREMIUM CONTENT MODULE #2 */
        /* PREMIUM CONTENT MODULE #3 */
        #premium-three .content { position: relative; width: 100%; padding-top: 4%; }
        #premium #premium-three .image { width: 90%; margin: 0 auto; }
        #premium #premium-three .image img.non-retina { display: none !important; }
        #premium #premium-three .image img.mobile { display: block !important; }
        /* PREMIUM CONTENT MODULE #4 */
        #premium-four .content { padding-top: 0; }
        /* PREMIUM CONTENT MODULE #5 */
    }    
    /* PHONE LANDSCAPE & PORTRAIT */
    @media only all and (max-width: 768px) {
        .mobile { display: block; width: 100% !important; }
        .desktop { display: none; }
        #premium { background-color: #fff; border: 1px solid #ccc; border-radius: 6px; }
        /* PREMIUM CONTENT MODULE GENERIC */
        .module {  }
        /* PREMIUM CONTENT MODULE #1 */
        #premium-one .content { width: 100%; padding: 0 8%; margin-bottom: 0; }
        #premium-one .content .badge img { margin-bottom: 2em; width: 30% !important; }
        #premium-one .content h4 { line-height: 1.2; }
        /* PREMIUM CONTENT MODULE #2 */
        #premium-two { margin-bottom: 2em; }
        /* PREMIUM CONTENT MODULE #3 */
        #premium-three .content { position: relative; padding: 2em; box-sizing: border-box; width: 100%; }
        #premium-three .content p { margin-top: 0.5em; }
        #premium-three .image { width: 90%; margin: 0 auto; }
        /* PREMIUM CONTENT MODULE #4 */
        #premium-four { margin-top: 1em; }
        #premium-four .image { width: 90%; }
        #premium-four .content { width: 100%; padding-top: 3%; }
        #premium-four .content h3 span { display: inline; }
        /* PREMIUM CONTENT MODULE #5 */
        #premium-five { box-sizing: border-box; float: none; margin: 3em 0 0; padding-right: 0; text-align: center; width: 100%; }
    }
    /* Only non-HD rule. */
    @media
    only screen and (        max-device-pixel-ratio: 1)   and (min-width: 769px),
    only screen and (-webkit-max-device-pixel-ratio: 1)   and (min-width: 769px),
    only screen and (   max--moz-device-pixel-ratio: 1)   and (min-width: 769px),
    only screen and (    -ms-max-device-pixel-ratio: 1)   and (min-width: 769px),
    only screen and (     -o-max-device-pixel-ratio: 1)   and (min-width: 769px),
    only screen and (        max-device-pixel-ratio: 1)   and (min-width: 769px),
    only screen and (           max-resolution: 100dpi)   and (min-width: 769px),
    only screen and (            max-resolution: 1dppx)   and (min-width: 769px) {
        #premium .retina { display: none !important; }
        #premium .non-retina { display: block !important; }
        #premium .mobile { display: none !important; }
    }
    /* Only HD rule. */
    @media
    only screen and (        min-device-pixel-ratio: 1.1)     and (min-width: 769px),
    only screen and (-webkit-min-device-pixel-ratio: 1.1)     and (min-width: 769px),
    only screen and (   min--moz-device-pixel-ratio: 1.1)     and (min-width: 769px),
    only screen and (    -ms-min-device-pixel-ratio: 1.1)     and (min-width: 769px),
    only screen and (   -o-min-device-pixel-ratio: 2/1.9)     and (min-width: 769px),
    only screen and (        min-device-pixel-ratio: 1.1)     and (min-width: 769px),
    only screen and (             min-resolution: 101dpi)     and (min-width: 769px),
    only screen and (            min-resolution: 1.1dppx)     and (min-width: 769px) {
        #premium .retina { display: block !important; }
        #premium .non-retina { display: none !important; }
        #premium .mobile { display: none !important; }
    }
    /* Only MOBILE rule. */
    @media
    only screen and (max-width: 768px) {
        #premium .retina { display: none !important; }
        #premium .non-retina { display: none !important; }
        #premium .mobile { display: block !important; }
    }











