    only screen and (        min-device-pixel-ratio: 1.1)     and (min-width: 769px),
    only screen and (             min-resolution: 101dpi)     and (min-width: 769px),
    only screen and (            min-resolution: 1.1dppx)     and (min-width: 769px) {
        #premium .retina { display: block !important; }
        #premium .non-retina { display: none !important; }
        #premium .mobile { display: none !important; }
    }
    /* Only MOBILE rule. */
    @media
    only screen and (max-width: 768px) {
        #premium .retina { display: none !important; }
        #premium .non-retina { display: none !important; }
        #premium .mobile { display: block !important; }
    }











