description:
"

                                OverviewThe Air Series AF140 fans let you have it all. Eleven ultra-thin, custom-molded blades push ample air volume. Rubber corners dramatically reduce vibration. The advanced hydraulic bearing system is quiet and reliable, and you can customize the look with the three included colored rings.AF models performs best in unrestricted spaces with at least 3cm of clearance, and they’re ideal for mounting at the rear or top of your PC case as exhaust fans for your PC’s motherboard and CPU, graphics accelerators, and other components Filling the case with heat. They work equally well for unrestricted intake fans, for areas like side panels or bottom intakes.Features* The AF140 Quiet Edition is a great choice for a quiet side panel intake or case exhaust, or even a “pull” fan for a radiator or heatsink;* Eleven ultra-thin blades for excellent airflow at very low noise levels;* Custom fan enclosure for ducting air in the right direction with minimal interference;* Advanced Hydraulic Bearing for reliable, quiet operation;* Rubberized corners for sound damping when installed with standard screws;* User-replaceable colored rings so you can match your fans to your case;* Included voltage step-down adapter for even quieter operation;* Available in single or twin packs;* 2 Years Manufacturers Warranty;Specification* Single Pack Part #: CO-9050009-WW;* Fan Size: 140mm x 25mm;* Noise (dBA): 24 dBA;* Airflow (CFM): 67.8 CFM;* Static Pressure (mm/H2O): 0.84 mm/H2O;* RPM: 1150 RPM;* Power Draw (@ +12V): .1A;* Warranty: 2 Years Manufacturers Warranty;

                            "

